// src/components/Navbar.js
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { useKeycloak } from '@react-keycloak/web';

const Navbar = () => {
  const { keycloak } = useKeycloak();

  const handleLogout = () => {
    keycloak.logout({ redirectUri: 'http://localhost:3002/' });
  };

  return (
    <AppBar position="static" sx={{ backgroundColor: "#1976d2" }}>
      <Toolbar>
        <Typography variant="h6" sx={{ flexGrow: 1 }}>
          AdamChat
        </Typography>
        <Box component="nav">
          <Button color="inherit" component={Link} to="/dashboard">Dashboard</Button>
          <Button color="inherit" component={Link} to="/chat">Chat</Button>
          <Button color="inherit" component={Link} to="/ficha-paciente">Ficha do Paciente</Button>
        </Box>
        {keycloak.authenticated && keycloak.tokenParsed && (
          <>
            <Typography variant="body1" sx={{ mr: 2 }}>
              {keycloak.tokenParsed.name || keycloak.tokenParsed.preferred_username}
            </Typography>
            <Button color="inherit" onClick={handleLogout}>Deslogar</Button>
          </>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
